import React from "react";

const Biographie = () => {
    return (
        <div className="Biographie modules">
            <span className="marquee">
                Je suis un développeur de qualité qualitatif ✓ J'apprends plus
                vite que mon ombre ✓ Je suis passionné ✓ Je suis motivé ✓ Je ne
                pratique pas le krav maga ✕
            </span>
            <span className="marquee2">
                Je suis un développeur de qualité qualitatif ✓ J'apprends plus
                vite que mon ombre ✓ Je suis passionné ✓ Je suis motivé ✓ Je ne
                pratique pas le krav maga ✕
            </span>
            <span className="marquee3">
                Je suis un développeur de qualité qualitatif ✓ J'apprends plus
                vite que mon ombre ✓ Je suis passionné ✓ Je suis motivé ✓ Je ne
                pratique pas le krav maga ✕
            </span>
        </div>
    );
};

export default Biographie;
